    <p className="mb-4">Check if your credentials have been leaked in a data breach.</p>
    {/* TODO: Implement breach check UI */}
    <div className="bg-white p-6 rounded-lg shadow text-gray-500">Breach alerts coming soon...</div>
  </div>
);

export default Breach;
